DROP TABLE IF EXISTS user;
DROP TABLE IF EXISTS properties;
DROP TABLE IF EXISTS formerProperties;

CREATE TABLE user (
  userId INTEGER PRIMARY KEY AUTOINCREMENT,
  username TEXT UNIQUE NOT NULL,
  password TEXT NOT NULL,
  email TEXT NOT NULL COLLATE NOCASE,
  firstName TEXT NOT NULL,
  lastName TEXT NOT NULL,
  description TEXT,
  profilePicture TEXT NOT NULL
);

DROP TABLE IF EXISTS properties;
CREATE TABLE properties(
   ID             INTEGER  PRIMARY KEY  AUTOINCREMENT NOT NULL
  ,class          VARCHAR(10)
  ,land_value     INTEGER  NOT NULL 
  ,bldg_value     INTEGER  NOT NULL
  ,total_value    INTEGER  NOT NULL
  ,address        VARCHAR(32) NOT NULL
  ,address_city   VARCHAR(15) 
  ,zip_code       INTEGER  NOT NULL
  ,owner          VARCHAR(50) 
  ,school_dist    INTEGER  
  ,land_sq_ft     INTEGER  
  ,year_built     INTEGER  NOT NULL
  ,living_sq_ft   INTEGER  NOT NULL
  ,condition      VARCHAR(12)
  ,residence_type VARCHAR(12) 
  ,building_style VARCHAR(16)
  ,bath           INTEGER  NOT NULL
  ,half_bath      INTEGER 
  ,bedrooms       INTEGER 
  ,basement_beds  INTEGER 
  ,total_beds     INTEGER  NOT NULL
  ,attached_gar   INTEGER  
  ,price          INTEGER  
  ,grade          VARCHAR(6) 
  ,like_dislike   BIT  NOT NULL
  ,userId INTEGER NOT NULL, FOREIGN KEY (userId) REFERENCES user(userId)
);

CREATE TABLE formerProperties(
   ID             INTEGER  PRIMARY KEY  AUTOINCREMENT NOT NULL
  ,class          VARCHAR(10)
  ,land_value     INTEGER  NOT NULL
  ,bldg_value     INTEGER  NOT NULL
  ,total_value    INTEGER  NOT NULL
  ,address        VARCHAR(32) NOT NULL
  ,address_city   VARCHAR(15) 
  ,zip_code       INTEGER  NOT NULL
  ,owner          VARCHAR(50) 
  ,school_dist    INTEGER  
  ,land_sq_ft     INTEGER  
  ,year_built     INTEGER  NOT NULL
  ,living_sq_ft   INTEGER  NOT NULL
  ,condition      VARCHAR(12)
  ,residence_type VARCHAR(12) 
  ,building_style VARCHAR(16)
  ,bath           INTEGER  NOT NULL
  ,half_bath      INTEGER 
  ,bedrooms       INTEGER 
  ,basement_beds  INTEGER 
  ,total_beds     INTEGER  NOT NULL
  ,attached_gar   INTEGER  
  ,price          INTEGER  
  ,grade          VARCHAR(6) 
  ,like_dislike   BIT  NOT NULL
  ,year_purchased INTEGER
  ,userId INTEGER NOT NULL, FOREIGN KEY (userId) REFERENCES user(userId)
);

/* This automatically adds new properties to the model when added to the previous owned table */
CREATE TRIGGER addFormerPropertyToModel AFTER INSERT on formerProperties

BEGIN

living_sq_ft,condition,residence_type,building_style,bath,half_bath,bedrooms,basement_beds,total_beds,attached_gar,price,grade,like_dislike,userID) 
VALUES (NEW.class, NEW.land_value, NEW.bldg_value, NEW.total_value, NEW.address, NEW.address_city, NEW.zip_code, NEW.owner, NEW.school_dist, NEW.land_sq_ft, 
NEW.year_built, NEW.living_sq_ft, NEW.condition, NEW.residence_type, NEW.building_style, NEW.bath, NEW.half_bath, NEW.bedrooms,
NEW.basement_beds, NEW.total_beds, NEW.attached_gar, NEW.price, NEW.grade, NEW.like_dislike, NEW.userId);

END;


/* When a user deletes a previously owned property, this will also delete it from the model */
CREATE TRIGGER deleteFormerPropertyInModel AFTER DELETE on formerProperties

BEGIN

DELETE FROM properties WHERE address = OLD.address AND zip_code = OLD.zip_code AND userId = OLD.userId;

END;


